import React from 'react';
import { Typography } from '@material-ui/core';
import { withStyles } from '@material-ui/styles';
import styles from './styles';

const TopDashBoard = props => {
    const { classes, account } = props;
    
    const data = [
        [22, 'Working late'],
        [18, 'Good evening'],
        [12, 'Good afternoon'],
        [5,  'Good morning'],
        [0,  'Whoa, early bird']
    ],
    hr = new Date().getHours();
    for (var i = 0; i < data.length; i++) {
        if (hr >= data[i][0]) {
            console.log(data[i][1])
            break;
        }
    }

    return (
        <div className={classes.row}>
            <Typography variant="h3" color="textPrimary">
                Good morning, {`${account.firstName} ${account.lastName}`}
            </Typography>
            <Typography variant="body1" className={classes.textBody}>Here's what's happening</Typography>
        </div>
    );
};
export default withStyles(styles)(TopDashBoard);
